export class User{
    username?: string;
   name?: string;
    email?: string;
    mobile?:number;
    password?:string;
    

constructor(username:string,name:string,email:string,mobile:number,password:string ){
   this.username=username;
this.name = name;
this.email = email;
this.mobile=mobile;
this.password=password


}
}
